import React, { Component } from 'react'

class UserGreeting extends Component {
    constructor(props) {
        super(props)

        this.state = {
            isLoggedIn: false
        }
    }

    render() {
        return (
            <div>

                <div>WelcomeGuest</div>

                <div>Welcome yash Kumar</div>
            </div>

        )
    }
}

export default UserGreeting
